  `sports_id2` int(10) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `stattabs_id` int(11) DEFAULT NULL,
  `datatype` varchar(255) DEFAULT NULL,
  `orderNum` int(11) DEFAULT NULL,
  `field_size` int(11) DEFAULT '30',
  `calc_formula` text,
  `is_calc` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `stat_sport1` (`sports_id`),
  KEY `stat_sport2` (`sports_id2`),
  KEY `stat_stattab` (`stattabs_id`),
  CONSTRAINT `stat_stattab` FOREIGN KEY (`stattabs_id`) REFERENCES `stattabs` (`id`),
  CONSTRAINT `stat_sport1` FOREIGN KEY (`sports_id`) REFERENCES `sports` (`id`),
  CONSTRAINT `stat_sport2` FOREIGN KEY (`sports_id2`) REFERENCES `sports` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

