  `orderNum` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `parent_tab` (`stattab_id`),
  KEY `tab_sport1` (`sport_id`),
  KEY `tab_sport2` (`sport_id2`),
  CONSTRAINT `tab_sport2` FOREIGN KEY (`sport_id2`) REFERENCES `sports` (`id`),
  CONSTRAINT `parent_tab` FOREIGN KEY (`stattab_id`) REFERENCES `stattabs` (`id`),
  CONSTRAINT `tab_sport1` FOREIGN KEY (`sport_id`) REFERENCES `sports` (`id`)
